package pl.coderslab.BWF.model;import lombok.Getter;import lombok.Setter;import javax.validation.constraints.NotNull;import javax.validation.constraints.PositiveOrZero;@Getter@Setterpublic class TypeMatch {    @NotNull    private Long matchId;    @NotNull    @PositiveOrZero    private Integer homeTeamResult;    @NotNull    @PositiveOrZero    private Integer awayTeamResult;    public TypeMatch(@NotNull Long matchId, @NotNull @PositiveOrZero Integer homeTeamResult, @NotNull @PositiveOrZero Integer awayTeamResult) {        this.matchId = matchId;        this.homeTeamResult = homeTeamResult;        this.awayTeamResult = awayTeamResult;    }}